import React from 'react'
import styled from 'styled-components'
const DashboardScreen = () => {
  return (
    <Wrapper>
    <div className='dashboxes'>
      <div>1</div>
      <div>2</div>
      <div>3</div>
      <div>4</div>
      <div>5</div>
      <div>6</div>
    </div>
    </Wrapper>
   
  )
}

export default DashboardScreen


const Wrapper = styled.div`

.dashboxes {
  width: 90%;
  margin: auto;
  display: flex;
  flex-wrap: wrap;
}
.dashboxes div {
  width: 200px;
}

`
